(function () {
    'use strict';

    let n = 0;
    setInterval(() => {
        const now = new Date();
        const btn = document.querySelector('button.yxtf-button.yxtf-button--primary.yxtf-button--large');
        if (btn && btn.offsetParent) {
            n++;
            btn.click();
            console.log(now.toLocaleString(), "找到显示出来的“继续学习”按钮，执行第" + n + "次点击。")
        } else {
            console.log(now.toLocaleString(), "未找到显示出来的“继续学习”按钮，共点击按钮" + n + "次。")
        }
    }, 5000);
})();